import React  from 'react'


const Weather = ({weather}) => {

  return (
    <div className='weather'>
      {
            <div className="weather-date">
              <h2>{weather.location.name}</h2>
              <h2>{weather.location.localtime}</h2>
            </div>
      }
    </div>
  )
}

export default Weather
